import React from 'react';
import Card from './Card';
//import faker from 'faker'
import './Card.css'
import expertList from './expertList'

function cardComponent(expert, i){
    return <Card
    avatar={expert.avatar}
    name={expert.name}
    position={expert.position}
    description= {expert.description}
/>
}
const CardList = () => {
    return <div className = "row">
       { expertList.map()}

        <Card
            avatar={expertList[1].avatar}
            name={expertList[1].name}
            position={expertList[1].position}
            description= {expertList[1].description}
        />
        <Card
            avatar={expertList[2].avatar}
            name={expertList[2].name}
            position={expertList[2].position}
            description= {expertList[2].description}
        />
        <Card
            avatar={expertList[3].avatar}
            name={expertList[3].name}
            position={expertList[3].position}
            description= {expertList[3].description}
        />
    </div>
}

export default CardList;
